import { useState, useEffect } from "react";
import { TodoType } from "./todo";
import Chart from "react-apexcharts";
import axios from "axios";

const TableTwo = () => {
  const [data, setData] = useState<TodoType[]>([]);
  const [table, setTable] = useState<TodoType[]>([]);
  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:9363/post/panel");
      setTable(response.data);
      setData(response.data);

      if (response.data && response.data.kullaniciAd) {
        setOptions(prevOptions => ({
          ...prevOptions,
          xaxis: {
            ...prevOptions.xaxis,
            categories: response.data.kullaniciAd
          }
        }));
      }

    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };


  useEffect(() => {
    fetchData();
  }, []);

  const [options, setOptions] = useState({
    chart: {
      id: "basic-bar"
    },
    xaxis: {
      categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999]
    }
  });

  const [series, setSeries] = useState([
    {
      name: "series-1",
      data: [30, 40, 45, 50, 49, 60, 70, 91]
    }
  ]);


  let totalDataCount: number = table.length;
  return (
    <>
        <Chart
              options={options}
              series={series}
              type="bar"
              width="500"
            />
    </>
  );
};
export default TableTwo;
